import Head from 'next/head';

const GoogleRecaptcha = () => {
    const loadRecaptcha = () => {
        console.log('loadRecaptcha');
    }
    
    return (
        <>
            <Head>
                <script src="https://www.google.com/recaptcha/api.js?onload=loadRecaptcha&render=explicit"></script>
            </Head>

            <div className="recaptcha__element">
                Recaptcha goes here!

                <div className="g-recaptcha" data-sitekey="XXXXXX" data-size="invisible" data-callback="formSubmit"></div>
            </div>
        </>
    );
}

const getRecaptcha = () => {
    console.log('getRecaptcha');
}

export default GoogleRecaptcha
